     super(props);
 }

 render(){
 return(
     <div>
    <Card  border="dark" style={{ width: '25rem',height:'35rem' }}>
       <Card.Img variant="top" src="assets/images/AYA.png" />
       <Card.Body>
              <Card.Title>Card Title</Card.Title>
    <Card.Text>

    </Card.Text>
    <Button variant="primary">Go somewhere</Button>
  </Card.Body>
</Card>

     </div>

 )
 }
}

export default AYA;
